import React from "react";
import { Link } from "react-router-dom";

const Home = blog => {
  postBlog = blog.map(post => (
    <div>
      <h2>{post.id}</h2>
      <h2>{post.title}</h2>
      <h2>{post.category}</h2>
      <h2>{post.text}</h2>
    </div>
  ));
  return (
    <div className="landingPage">
      <Link to="/about">
        <h3>Add post</h3>
      </Link>
      {}
    </div>
  );
};

export default Home;
